o, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); position: relative;\">Eligibility</h3><p style=\"font-size: 14.8px;\"><br style=\"box-sizing: border-box; font-family: Lato, sans-serif; color: rgb(0, 0, 0); font-size: 16px;\"></p><p style=\"box-sizing: border-box; letter-spacing: 0.5px; font-family: Lato, sans-serif; text-align: justify; color: rgb(0, 0, 0); font-size: 18px !important; line-height: 30px !important;\">As per norms of Kerala University of Health Science (KUHS) admission for B.Sc. Nursing, the minimum educational requirements shall be the passing of: Higher Secondary School Certificate Examination (12 years course), Or Senior School Certificate Examination (10+2), Pre-Degree Examination (10+2), Or An equivalent with 12 years schooling from a recognized board or university with Science (Physics, Chemistry, Biology) and English with minimum of 50% aggregate marks.</p><h3 style=\"box-sizing: border-box; font-family: Lato, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); position: relative;\">Duration:8 Semesters</h3><p style=\"box-sizing: border-box; font-size: 14.8px; line-height: 1.2; font-family: Lato, sans-serif; position: relative; color: rgb(0, 0, 0);\"><br></p><p style=\"box-sizing: border-box; font-size: 14.8px; line-height: 1.2; font-family: Lato, sans-serif; position: relative; color: rgb(0, 0, 0);\"><br style=\"box-sizing: border-box; font-size: 16px;\"></p><h3 style=\"box-sizing: border-box; font-family: Lato, sans-serif; line-height: 1.2; color: rgb(0, 0, 0); position: relative;\">How to apply</h3><p style=\"box-sizing: border-box; font-size: 14.8px; line-height: 1.2; font-family: Lato, sans-serif; position: relative; color: rgb(0, 0, 0);\"><br style=\"box-sizing: border-box; font-size: 16px;\"></p><p style=\"box-sizing: border-box; letter-spacing: 0.5px; font-family: Lato, sans-serif; text-align: justify; color: rgb(0, 0, 0); font-size: 18px !important; line-height: 30px !important;\">All applications shall be submitted ONLINE on the 